import classes from "./Order.module.css";

function Order() {
  return (
    <>
      <div className="container">
        <div>
          <div>Status : Delivered</div>
          <div>Product List</div>
          <hr className={classes.dashed}></hr>
          <div>Date : Time</div>
          <div>Bill Amount:</div>
          <div></div>
        </div>
      </div>
    </>
  );
}

export default Order;
